import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={styles.navbar}>
      <h2 style={styles.logo}>ü•ó PEAS</h2> {/* Peas emoji added here */}
      <div style={styles.navLinks}>
        <Link to="/" style={styles.link}>üè† Home</Link>
        <Link to="/museums" style={styles.link}>üèõÔ∏è Museums</Link>
        <Link to="/about" style={styles.link}>‚ÑπÔ∏è About</Link>
        <Link to="/chat" style={styles.link}>üí¨ Chat</Link>
        <Link to="/contact" style={styles.link}>üìû Contact</Link>
      </div>
    </nav>
  );
}

const styles = {
  navbar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: "#2E8B57",
    padding: "10px 20px",
  },
  logo: {
    color: "white",
    margin: 0,
    fontSize: "24px",
  },
  navLinks: {
    display: "flex",
    gap: "20px",
  },
  link: {
    color: "white",
    textDecoration: "none",
    fontSize: "18px",
    display: "flex",
    alignItems: "center",
    gap: "6px",
  },
};

export default Navbar;
